CREATE PROCEDURE [dbo].[dsi_sp_BuildDriverTables_EACCHOSPEX]
    @SystemID char(12)
AS
SET NOCOUNT ON;
/**********************************************************************************
Client Name: OutBox Sys

Created By: Lea King
Business Analyst: James Bender
Create Date: 04/05/2021
Service Request Number: TekP-2020-11-11-0001

Purpose: MetLife Accident and Hospital Export

Revision History
----------------
Update By           Date           Request Num        Desc
XXXX                XX/XX/2021     SR-2021-000XXXXX   XXXXX

SELECT * FROM dbo.U_dsi_Configuration WHERE FormatCode = 'EACCHOSPEX';
SELECT * FROM dbo.U_dsi_SqlClauses WHERE FormatCode = 'EACCHOSPEX';
SELECT * FROM dbo.U_dsi_Parameters WHERE FormatCode = 'EACCHOSPEX';
SELECT ExpFormatCode, ExpExportCode, ExpStartPerControl, ExpEndPerControl,* FROM dbo.AscExp WHERE expFormatCode = 'EACCHOSPEX';
SELECT * FROM dbo.U_dsi_InterfaceActivityLog WHERE FormatCode = 'EACCHOSPEX' ORDER BY RunID DESC;

Execute Export
--------------
EXEC dbo.dsi_sp_TestSwitchbox_v2 'EACCHOSPEX', 'ONDEM_XOE';
EXEC dbo.dsi_sp_TestSwitchbox_v2 'EACCHOSPEX', 'TEST_XOE';
EXEC dbo.dsi_sp_TestSwitchbox_v2 'EACCHOSPEX', 'OEPASSIVE';
EXEC dbo.dsi_sp_TestSwitchbox_v2 'EACCHOSPEX', 'OEACTIVE';
EXEC dbo.dsi_sp_TestSwitchbox_v2 'EACCHOSPEX', 'SCH_EACCHO';

EXEC dbo.dsi_BDM_sp_ErrorCheck 'EACCHOSPEX';

EXEC dbo._dsi_usp_ExportRipOut @FormatCode = 'EACCHOSPEX', @AllObjects = 'Y', @IsWeb = 'Y'
**********************************************************************************/
BEGIN

    --==========================================
    -- Declare variables
    --==========================================
    DECLARE  @FormatCode        VARCHAR(10)
            ,@ExportCode        VARCHAR(10)
            ,@StartDate         DATETIME
            ,@EndDate           DATETIME
            ,@StartPerControl   VARCHAR(9)
            ,@EndPerControl     VARCHAR(9);

    -- Set FormatCode
    SELECT @FormatCode = 'EACCHOSPEX';

    -- Declare dates from Parameter file
    SELECT
         @StartPerControl = StartPerControl
        ,@EndPerControl   = EndPerControl
        ,@StartDate       = LEFT(StartPerControl,8)
        ,@EndDate         = DATEADD(S,-1,DATEADD(D,1,LEFT(EndPerControl,8)))
        ,@ExportCode      = ExportCode
    FROM dbo.U_dsi_Parameters WITH (NOLOCK)
    WHERE FormatCode = @FormatCode;

    --==========================================
    -- Clean EE List 
    -- Caution: Careful of cleaning EE List if including paycheck data
    --==========================================

    -- Cleans EE List of terms where EE active in another company (transfer), or active in more than one company
    DELETE FROM dbo.U_EACCHOSPEX_EEList
    WHERE xCoID <> dbo.dsi_BDM_fn_GetCurrentCOID(xEEID)
    AND xEEID IN (SELECT xEEID FROM dbo.U_EACCHOSPEX_EEList GROUP BY xEEID HAVING COUNT(1) > 1);


    DELETE FROM dbo.U_EACCHOSPEX_EEList WHERE xEEID IN (
        SELECT DISTINCT EecEEID FROM dbo.EmpComp WHERE EecEEType IN ('TES')
    )

    --==========================================
    -- Create Deduction List
    --==========================================
    DECLARE @DedList VARCHAR(MAX)
    SET @DedList = 'ACCH,ACCL,HOH,HOL';

    IF OBJECT_ID('U_EACCHOSPEX_DedList','U') IS NOT NULL
        DROP TABLE dbo.U_EACCHOSPEX_DedList;
    SELECT DISTINCT
         DedCode = DedDedCode
        ,DedType = DedDedType
    INTO dbo.U_EACCHOSPEX_DedList
    FROM dbo.fn_ListToTable(@DedList)
    JOIN dbo.DedCode WITH (NOLOCK)
        ON DedDedCode = Item;


    --==========================================
    -- BDM Section
    --==========================================
    DELETE FROM dbo.U_dsi_BDM_Configuration WHERE FormatCode = @FormatCode;

    -- Required parameters

    -- Non-Required parameters

    -- Required OE parameters
    IF @ExportCode LIKE '%PASSIVE'
    BEGIN
    END;

    IF @ExportCode LIKE '%ACTIVE'
    BEGIN
    END;


    -- Run BDM Module
    EXEC dbo.dsi_BDM_sp_PopulateDeductionsTable @FormatCode;

    --==========================================
    -- Build Driver Tables
    --==========================================
    ---------------------------------
    -- DETAIL RECORD - U_EACCHOSPEX_drvTbl
    ---------------------------------
    IF OBJECT_ID('U_EACCHOSPEX_drvTbl','U') IS NOT NULL
        DROP TABLE dbo.U_EACCHOSPEX_drvTbl;
    SELECT DISTINCT
         drvEEID = xEEID
        ,drvCoID = xCoID
        ,drvDepRecID = CONVERT(varchar(12),'1') --DELETE IF NOT USING DEPENDENT DATA
        ,drvSort = xEEID + CASE WHEN BdmRecType = 'EMP' THEN ' 1' ELSE ' 2' END
        -- standard fields above and additional driver fields below
        ,drvTransactionCode = CASE WHEN BdmRecType = 'EMP' THEN 'E' ELSE 'D' END
        ,drvCustomerNumber = '9218761'
        ,drvEmployeeNumber = EepSSN 
        ,drvNameLast = CASE WHEN BdmRecType = 'EMP' THEN EepNameLast ELSE ConNameLast END
        ,drvNameFirst = CASE WHEN BdmRecType = 'EMP' THEN EepNameFirst ELSE ConNameFirst END
        ,drvNameMiddle = LEFT(EepNameMiddle,1)
        ,drvDateOfBirth = CASE WHEN BdmRecType = 'EMP' THEN EepDateOfBirth ELSE ConDateOfBirth END
        ,drvMaritalStatus = eepMaritalStatus
        ,drvGender = CASE WHEN BdmRecType = 'EMP' THEN EepGender ELSE ConGender END
        ,drvRelationshipCode =    CASE WHEN ConRelationship IN ('DP','SPS') THEN '01'
                                    WHEN ConRelationship IN ('CHL','STC','DPC','DCH') THEN '02'
                                    ELSE '00'
                                END
        ,drvEmployeeDateOfHire = EecDateOfLastHire
        ,drvPersonnelIdentification = EecEmpNo
        ,drvPhoneNumber = EepPhoneHomeNumber
        ,drvEmailAddress = EepAddressEMail
        ,drvStreetAddress = dbo.iex_fn_RemovePunctuation(EepAddressLine1 + ' ' + ISNULL(EepAddressLine2, ''), '', '')
        ,drvAddressCity = EepAddressCity
        ,drvAddressState = EepAddressState
        ,drvAddressZipCode = EepAddressZipCode
        ,drvEmployeeStatusCode =    CASE WHEN EecEmplStatus = 'T' AND EecTermReason = '203' THEN 'D'
                                        WHEN EecEmplStatus = 'T' AND EecTermReason = '202' THEN 'R'
                                        WHEN EecEmplStatus = 'T' AND EecTermReason NOT IN ('202','203') THEN 'T'
                                        ELSE 'A'
                                    END
        ,drvStatusCodeEffectiveDate = CASE WHEN EecEmplStatus = 'T' THEN EecDateOfTermination ELSE EecDateOfLastHire END
        ,drvCoverageCode23 = CASE WHEN ACCH_DedCode IS NOT NULL OR ACCL_DedCode IS NOT NULL THEN 'AH' END
        ,drvCoverageStartDate23 =    CASE WHEN ACCH_DedCode IS NOT NULL THEN ACCH_BenStartDate
                                        WHEN ACCL_DedCode IS NOT NULL THEN ACCL_BenStartDate
                                    END
        ,drvCoverageStopDate23 =    CASE WHEN ACCH_DedCode IS NOT NULL THEN ACCH_BenStopDate
                                        WHEN ACCL_DedCode IS NOT NULL THEN ACCL_BenStopDate
                                    END
        ,drvGroupNumber23 = CASE WHEN ACCH_DedCode IS NOT NULL OR ACCL_DedCode IS NOT NULL THEN '0218761' END
        ,drvSubCode23 = CASE WHEN ACCH_DedCode IS NOT NULL OR ACCL_DedCode IS NOT NULL THEN '0001' END
        ,drvBranch23 =    CASE WHEN ACCH_DedCode IS NOT NULL THEN '0001'
                            WHEN ACCL_DedCode IS NOT NULL THEN '0003'
                        END
        ,drvMembersCoveredCode23 =    CASE WHEN ACCH_DedCode IS NOT NULL OR ACCL_DedCode IS NOT NULL THEN
                                        CASE WHEN ACCH_BenOption = 'EE' OR ACCL_BenOption = 'EE' THEN '1'
                                            WHEN ACCH_BenOption IN ('EEF','EEDPF') OR ACCL_BenOption IN ('EEF','EEDPF') THEN '4'
                                            WHEN ACCH_BenOption = 'EEC' OR ACCL_BenOption = 'EEC' THEN '2'
                                            WHEN ACCH_BenOption IN ('EES','EEDP') OR ACCL_BenOption IN ('EES','EEDP') THEN '3'
                                        END
                                    END
        ,drvEnrollmentStatus23 = CASE WHEN ACCH_DedCode IS NOT NULL OR ACCL_DedCode IS NOT NULL THEN 'P' END
        ,drvVoluntaryCancellationInd23 = CASE WHEN (ACCH_DedCode IS NOT NULL OR ACCL_DedCode IS NOT NULL) AND EecEmplStatus = 'A' AND (ACCH_BenStatus <> 'A' OR ACCL_BenStatus <> 'A') THEN 'CE' END
        ,drvCoverageCode24 = CASE WHEN HOH_DedCode IS NOT NULL OR HOL_DedCode IS NOT NULL THEN 'HH' END
        ,drvCoverageStartDate24 =    CASE WHEN HOH_DedCode IS NOT NULL THEN HOH_BenStartDate
                                        WHEN HOL_DedCode IS NOT NULL THEN HOL_BenStartDate
                                    END
        ,drvCoverageStopDate24 =    CASE WHEN HOH_DedCode IS NOT NULL THEN HOH_BenStopDate
                                        WHEN HOL_DedCode IS NOT NULL THEN HOL_BenStopDate
                                    END
        ,drvGroupNumber24 = CASE WHEN HOH_DedCode IS NOT NULL OR HOL_DedCode IS NOT NULL THEN '0231432' END
        ,drvSubCode24 = CASE WHEN HOH_DedCode IS NOT NULL OR HOL_DedCode IS NOT NULL THEN '0001' END
        ,drvBranch24 =    CASE WHEN HOH_DedCode IS NOT NULL THEN '0001'
                            WHEN HOL_DedCode IS NOT NULL THEN '0003'
                        END
        ,drvMembersCoveredCode24 =    CASE WHEN HOH_DedCode IS NOT NULL OR HOL_DedCode IS NOT NULL THEN
                                        CASE WHEN HOH_BenOption = 'EE' OR HOL_BenOption = 'EE' THEN '1'
                                            WHEN HOH_BenOption IN ('EEF','EEDPF') OR HOL_BenOption IN ('EEF','EEDPF') THEN '4'
                                            WHEN HOH_BenOption = 'EEC' OR HOL_BenOption = 'EEC' THEN '2'
                                            WHEN HOH_BenOption IN ('EES','EEDP') OR HOL_BenOption IN ('EES','EEDP') THEN '3'
                                        END
                                    END
        ,drvEnrollmentStatus24 = CASE WHEN HOH_DedCode IS NOT NULL OR HOL_DedCode IS NOT NULL THEN 'P' END
        ,drvVoluntaryCancellationInd24 = CASE WHEN (HOH_DedCode IS NOT NULL OR HOL_DedCode IS NOT NULL) AND EecEmplStatus = 'A' AND (HOH_BenStatus <> 'A' OR HOL_BenStatus <> 'A') THEN 'CE' END
    INTO dbo.U_EACCHOSPEX_drvTbl
    FROM dbo.U_EACCHOSPEX_EEList WITH (NOLOCK)
    JOIN dbo.EmpPers WITH (NOLOCK)
        ON EepEEID = xEEID
    JOIN dbo.vw_int_EmpComp WITH (NOLOCK)
        ON EecEEID = xEEID 
        AND EecCoID = xCoID
    JOIN (
            SELECT BdmRecType
                ,BdmCOID
                ,BdmEEID
                ,BdmDepRecId
                ,MAX(CASE WHEN BdmDedCode = 'ACCH' THEN BdmDedCode END) AS ACCH_DedCode
                ,MAX(CASE WHEN BdmDedCode = 'ACCL' THEN BdmDedCode END) AS ACCL_DedCode
                ,MAX(CASE WHEN BdmDedCode = 'HOH' THEN BdmDedCode END) AS HOH_DedCode
                ,MAX(CASE WHEN BdmDedCode = 'HOL' THEN BdmDedCode END) AS HOL_DedCode
                ,MAX(CASE WHEN BdmDedCode = 'ACCH' THEN BdmBenStartDate END) AS ACCH_BenStartDate
                ,MAX(CASE WHEN BdmDedCode = 'ACCL' THEN BdmBenStartDate END) AS ACCL_BenStartDate
                ,MAX(CASE WHEN BdmDedCode = 'HOH' THEN BdmBenStartDate END) AS HOH_BenStartDate
                ,MAX(CASE WHEN BdmDedCode = 'HOL' THEN BdmBenStartDate END) AS HOL_BenStartDate
                ,MAX(CASE WHEN BdmDedCode = 'ACCH' THEN BdmBenStopDate END) AS ACCH_BenStopDate
                ,MAX(CASE WHEN BdmDedCode = 'ACCL' THEN BdmBenStopDate END) AS ACCL_BenStopDate
                ,MAX(CASE WHEN BdmDedCode = 'HOH' THEN BdmBenStopDate END) AS HOH_BenStopDate
                ,MAX(CASE WHEN BdmDedCode = 'HOL' THEN BdmBenStopDate END) AS HOL_BenStopDate
                ,MAX(CASE WHEN BdmDedCode = 'ACCH' THEN BdmBenOption END) AS ACCH_BenOption
                ,MAX(CASE WHEN BdmDedCode = 'ACCL' THEN BdmBenOption END) AS ACCL_BenOption
                ,MAX(CASE WHEN BdmDedCode = 'HOH' THEN BdmBenOption END) AS HOH_BenOption
                ,MAX(CASE WHEN BdmDedCode = 'HOL' THEN BdmBenOption END) AS HOL_BenOption
                ,MAX(CASE WHEN BdmDedCode = 'ACCH' THEN BdmBenStatus END) AS ACCH_BenStatus
                ,MAX(CASE WHEN BdmDedCode = 'ACCL' THEN BdmBenStatus END) AS ACCL_BenStatus
                ,MAX(CASE WHEN BdmDedCode = 'HOH' THEN BdmBenStatus END) AS HOH_BenStatus
                ,MAX(CASE WHEN BdmDedCode = 'HOL' THEN BdmBenStatus END) AS HOL_BenStatus
            FROM dbo.U_dsi_BDM_EACCHOSPEX WITH (NOLOCK)
            GROUP BY BdmRecType, BdmCOID, BdmEEID, BdmDepRecID) AS BDM
        ON BdmEEID = xEEID 
        AND BdmCoID = xCoID
    LEFT JOIN dbo.Contacts WITH (NOLOCK)
        ON ConEEID = xEEID
        AND ConSystemID = BdmDepRecID
    ;

    --==========================================
    -- Set FileName
    --==========================================
    IF (dbo.dsi_fnVariable(@FormatCode,'UseFileName') = 'N')
    BEGIN
        UPDATE dbo.U_dsi_Parameters
            SET ExportFile = CASE WHEN dbo.dsi_fnVariable(@FormatCode,'Testing') = 'Y' THEN 'Test_Filename_' + CONVERT(VARCHAR(8),GETDATE(),112) + '.txt'
                                  WHEN @ExportCode LIKE 'OE%' THEN 'OE_Filename_' + CONVERT(VARCHAR(8),GETDATE(),112) + '.txt'
                                  ELSE 'Filename_' + CONVERT(VARCHAR(8),GETDATE(),112) + '.txt'
                             END
        WHERE FormatCode = @FormatCode;
    END

END;
/**********************************************************************************

--Alter the View
ALTER VIEW dbo.dsi_vwEACCHOSPEX_Export AS
    SELECT TOP 20000000 Data FROM dbo.U_EACCHOSPEX_File (NOLOCK)
    ORDER BY RIGHT(RecordSet,2), InitialSort, SubSort;

--Check out AscDefF
SELECT * FROM dbo.AscDefF
WHERE AdfHeaderSystemID LIKE 'EACCHOSPEX%'
ORDER BY AdfSetNumber, AdfFieldNumber;

--Update Dates
UPDATE dbo.AscExp
    SET expLastStartPerControl = '202103291'
       ,expStartPerControl     = '202103291'
       ,expLastEndPerControl   = '202104059'
       ,expEndPerControl       = '202104059'
WHERE expFormatCode = 'EACCHOSPEX';

**********************************************************************************/
GO
CREATE VIEW dbo.dsi_vwEACCHOSPEX_Export AS 
    SELECT TOP 200000000 Data FROM dbo.U_EACCHOSPEX_File WITH (NOLOCK)
    ORDER BY RIGHT(RecordSet,2), InitialSort